import React, { Component } from "react";
import '../App.css';
import ClassificacaoDataService from "../services/classificacao.service";

export default class Classificacao extends Component {
	constructor(props) {
		super(props);
		this.retrieveClassificacao = this.retrieveClassificacao.bind(this);

		this.state = {
			classificao: [],
		};
	}

	componentDidMount() {
		this.retrieveClassificacao();
	}


	retrieveClassificacao() {
		ClassificacaoDataService.getAll()
			.then(response => {
				this.setState({
					classificacao: response.data
				});
				console.log(response.data);
			})
			.catch(e => {
				console.log(e);
			});
	}

	render() {
		const { classificacao } = this.state;

		return (

			<div>
				<div className="classificao-header m-5">
					<h1>Classificação</h1>
				</div>

				<table className="table table-dark table-bordered w-auto my-3 mx-auto">
					<thead>
						<tr>
							<th scope="col">#</th>
							<th scope="col">Time</th>
							<th scope="col">Técnico</th>
							<th scope="col">Pontuação</th>
						</tr>
					</thead>
					<tbody>
						{classificacao &&
							classificacao.map((classificacao, index) => (
								<tr>
									<th scope="row">{index}</th>
									<td>{classificacao.nome}</td>
									<td>{classificacao.tecnico}</td>
									<td>{classificacao.pontuacao}</td>
								</tr>
							))}
					</tbody>
				</table>
			</div>

		);
	}
}
